DROP TABLE IF EXISTS `rva_viewbutton`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `rva_viewbutton` (
  `id` varchar(64) NOT NULL COMMENT 'ID',
  `name` varchar(100) DEFAULT NULL COMMENT '名称',
  `type` varchar(200) DEFAULT NULL COMMENT '类型',
  `idx` int(11) DEFAULT '0' COMMENT '索引',
  `icon` varchar(50) DEFAULT NULL COMMENT '图标',
  `cls` varchar(50) DEFAULT NULL COMMENT '样式',
  `position` varchar(50) DEFAULT NULL COMMENT '位置',
  `readonly_show` varchar(1) DEFAULT 'N' COMMENT '只读显示',
  `action` varchar(500) DEFAULT NULL COMMENT '动作',
  `action_url` varchar(4000) DEFAULT NULL COMMENT '动作Url',
  `action_dialog_view_id` varchar(200) DEFAULT NULL COMMENT '弹框视图',
  `action_dialog_app_id` varchar(200) DEFAULT NULL COMMENT '弹框应用',
  `action_success` varchar(30) DEFAULT NULL COMMENT '动作成功',
  `action_failure` varchar(30) DEFAULT NULL COMMENT '动作失败',
  `select_type` varchar(30) DEFAULT NULL COMMENT 'selectType',
  `show_if` varchar(200) DEFAULT NULL COMMENT '显示条件',
  `view_id` varchar(64) NOT NULL COMMENT '视图ID',
  `data` text COMMENT '其他数据',
  `rva_update_time_` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '时间戳',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='视图属性';
