--
-- Table structure for table `rva_viewproperty`
--

DROP TABLE IF EXISTS `rva_viewproperty`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `rva_viewproperty` (
  `id` varchar(64) NOT NULL COMMENT 'ID',
  `name` varchar(100) DEFAULT NULL COMMENT '名称',
  `type` varchar(50) DEFAULT NULL COMMENT '类型',
  `idx` int(11) DEFAULT '0' COMMENT '索引',
  `prop_id` varchar(64) DEFAULT NULL COMMENT '属性ID',
  `prop_sub_id` varchar(64) DEFAULT NULL COMMENT '属性子ID',
  `relation_id` varchar(100) DEFAULT NULL COMMENT '关系ID',
  `width` int(11) DEFAULT '0' COMMENT '宽度',
  `height` int(11) DEFAULT '0' COMMENT '高度',
  `form_init_value` varchar(1000) DEFAULT NULL COMMENT '加载值',
  `form_init_replace_empty` varchar(1) DEFAULT 'Y' COMMENT '空时替换加载值',
  `form_init_replace` varchar(1) DEFAULT 'N' COMMENT '非空替换加载值',
  `form_submit_value` varchar(1000) DEFAULT NULL COMMENT '提交值',
  `form_submit_replace_empty` varchar(1) DEFAULT 'N' COMMENT '空时替换提交值',
  `form_submit_replace` varchar(1) DEFAULT 'N' COMMENT '非空替换提交值',
  `form_submit` varchar(1) DEFAULT 'Y' COMMENT '是否提交',
  `form_row_span` int(11) DEFAULT '1' COMMENT '跨行',
  `form_col_span` int(11) DEFAULT '1' COMMENT '跨列',
  `form_required` varchar(1) DEFAULT 'N' COMMENT '必需',
